import React from 'react';
import '../assets/styles/Nav.css';
import '../assets/styles/App.css';

const Projects = () => {
  const projects = [
    {
      title: "NexusFlow",
      info: "June 23 // Design UI & UX",
      description: "Revolutionary user interface design system for enterprise applications with focus on accessibility and modern aesthetics."
    },
    {
      title: "QuantumCore", 
      info: "April 22 // Software Dev",
      description: "High-performance backend framework built with Node.js and Rust, handling millions of requests with minimal latency."
    },
    {
      title: "ShadowNet",
      info: "March 24 // Malware Analysis", 
      description: "Advanced malware detection and analysis platform using machine learning to identify zero-day threats in real-time."
    },
    {
      title: "VulnScan Pro",
      info: "November 19 // Pentesting",
      description: "Comprehensive penetration testing toolkit with automated vulnerability assessment and detailed reporting capabilities."
    },
    {
      title: "CroCoToolz",
      info: "September 25 // CyberSec Tools Dev",
      description: "Suite of custom cybersecurity tools for network monitoring, encryption analysis, and threat intelligence gathering."
    },
    {
      title: "MobiSecure",
      info: "January 23 // Mobile App Development",
      description: "Secure mobile banking application with biometric authentication and real-time fraud detection systems."
    },
    {
      title: "CloudShield", 
      info: "July 22 // Cloud Infrastructure",
      description: "Multi-cloud security infrastructure with automated compliance checking and centralized management dashboard."
    },
    {
      title: "DataCrypt",
      info: "August 23 // Encryption Systems",
      description: "Next-generation encryption protocol implementation with quantum-resistant algorithms and secure key exchange."
    },
    {
      title: "NetWatch",
      info: "December 24 // Network Security",
      description: "Real-time network traffic analysis and intrusion detection system with AI-powered threat classification."
    },
    {
      title: "SecureComm",
      info: "May 23 // Secure Communications",
      description: "End-to-end encrypted messaging platform with self-destructing messages and secure file sharing capabilities."
    }
  ];

  return (
    <div className="projects__container">
      <div className='projects__list'>
        {projects.map((project, index) => (
          <div key={index} className='project__item'>
            <div className='project__title'>{project.title}</div>
            <div className='project__info'>{project.info}</div>
            {/* Si quieres mostrar la descripción también */}
            {/* <div className='project__description'>{project.description}</div> */}
          </div>
        ))}
      </div>
    </div>
  );
};

export default Projects;
